import Header from "../components/Header"
import logo from "../images/logo2.svg";


function Homepage () {
return(
    <div className="home-cont">

        <div className="header-tittle">
        <img className="logo" src={logo} />
        </div>

    <div className="home-button">
        <p>Explorar</p>
    </div>


</div>
)
}

export default Homepage
